<!DOCTYPE html>
<html lang="pt-br">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Gerar PDF com Javascript</title>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/html2pdf.js/0.10.2/html2pdf.bundle.min.js"
        integrity="sha512-MpDFIChbcXl2QgipQrt1VcPHMldRILetapBl5MPCA9Y8r7qvlwx1/Mc9hNTzY+kS5kX6PdoDq41ws1HiVNLdZA=="
        crossorigin="anonymous" referrerpolicy="no-referrer">
    </script>
    <script>
        window.onload = function() {
            const btnGerarPDF = document.querySelector('#generate-pdf');
            btnGerarPDF.addEventListener('click', () => {
                //conteudo do PDF
                const content = document.querySelector('#content');

                //configuracao do arquivo
                const options = {
                    margin: [10, 10, 10, 10],
                    filename: 'arquivo.pdf',
                    html2canvas: {
                        scale: 2
                    },
                    jsPDF: {
                        unit: 'mm',
                        format: 'a4',
                        orientation: 'portrait'
                    }
                };

                //Gerar e baixar o PDF
                // html2pdf(content);
                // html2pdf(content, options);
                html2pdf(content, {
                    filename: 'objetoDireto.pdf'
                });
                // html2pdf().set(options).from(content).save();
            });
        }
    </script>
</head>

